import React from 'react';
import styles from './image.module.css';

const image = ({ alt, src, ...props }) => {
  return (
    <div className={styles.wrapper}>
      <div className={styles.skeleton}></div>
      <img
        onLoad={() => alert()}
        alt={alt}
        src={src}
        {...props}
        className={styles.img}
      />
    </div>
  );
};

export default image;
